export const TileList = ({object}) => {
  
  return (
    <div>
      {
        objects.map((object)=>{
          const {name}= object;
          const description= {name, ...object};
          <li>
            <tile
            name= {name}
            description= {description}
          ></tile>
          </li>
          
        })
      }
    </div>
  );
};
